// import React from 'react';

const Header = () => {
  return (
    <>
      <div className="grid grid-cols-1 sm:grid-cols-3 md:grid-cols-3 gap-4 mt-6">
        <div className="bg-red-900">01</div>
        <div className="bg-yellow-900">02</div>
        <div className="bg-green-800">03</div>
      </div>
    </>
  );
};

export default Header;
